import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Progress = () => {
  const [progress, setProgress] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchProgress = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) {
          setError('Please login to view progress');
          setLoading(false);
          return;
        }

        const res = await axios.get('http://localhost:5000/api/progress', {
          headers: {
            Authorization: `Bearer ${token}`
          }
        });

        if (res.data.success) {
          setProgress(res.data.data || []);
        } else {
          setError('Failed to load progress data');
        }
      } catch (err) {
        console.error('Error fetching progress:', err);
        setError(err.response?.data?.error || 'Failed to load progress');
      } finally {
        setLoading(false);
      }
    };
    fetchProgress();
  }, []);

  if (loading) {
    return (
      <div className="container mt-4">
        <div className="text-center">
          <div className="spinner-border" role="status">
            <span className="visually-hidden">Loading...</span>
          </div>
          <p>Loading progress...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mt-4">
        <div className="alert alert-danger">
          <h4>Error Loading Progress</h4>
          <p>{error}</p>
        </div>
      </div>
    );
  }

  return (
    <div className="container mt-4">
      <h2>Progress Dashboard</h2>
      {progress.length === 0 ? (
        <div className="alert alert-info">
          <h4>No Progress Data</h4>
          <p>You haven't created any habits yet. Start by adding some habits to track your progress!</p>
        </div>
      ) : (
        <div className="row">
          {progress.map(item => (
            <div key={item.habitId || item._id} className="col-md-6 mb-4">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">{item.habitName}</h5>
                  <div className="row">
                    <div className="col-6">
                      <p className="mb-1"><strong>Total Days:</strong> {item.totalDays}</p>
                      <p className="mb-1"><strong>Completed:</strong> {item.completedDays}</p>
                    </div>
                    <div className="col-6">
                      <p className="mb-1"><strong>Completion Rate:</strong> {item.completionRate}%</p>
                      <p className="mb-1"><strong>Current Streak:</strong> {item.currentStreak}</p>
                    </div>
                  </div>
                  <div className="mt-3">
                    <h6>Recent Progress:</h6>
                    <div className="d-flex gap-1">
                      {(item.recentProgress || []).slice(0, 7).map((day, index) => (
                        <div
                          key={index}
                          className={`badge ${day.completed ? 'bg-success' : 'bg-secondary'}`}
                          style={{ width: '30px', height: '30px', borderRadius: '50%', display: 'flex', alignItems: 'center', justifyContent: 'center' }}
                        >
                          {day.completed ? '✓' : '○'}
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Progress;
